import Header from '../components/Header';
import Layout from '../Components/Layout';
import Form from '../Components/Form';
class Index extends React.Component {
    render(){
        return (
            <Layout>
                <p>Hej</p>
                <Form></Form>
            </Layout>
        );
    }
}
export default Index;
